import React, {Component} from 'react';
import {
    HeroImageComp,
    HeroLoginWrapper,
    LoginForm,
    LoginFormWrapper,
    LoginWrapper,
    LogoLogin
} from "../styled/Login.styled";
import HeroImage from "../assets/press_login_hero.svg"
import PressLogo from "../assets/temp_mail_logo.png"
import {AdminH1, AdminInputIcon, AdminTextInput, AdminTextInputWrapper} from "../styled/Common.styled";
import "bootstrap-icons/font/bootstrap-icons.css"

class Login extends Component {
    render() {
        return (
            <LoginWrapper>
                <HeroLoginWrapper>
                    <HeroImageComp src={HeroImage}/>
                </HeroLoginWrapper>
               <LoginFormWrapper>
                   <LoginForm>
                       <LogoLogin>
                           <img src={PressLogo} alt={"Logo"}/>
                       </LogoLogin>
                       <AdminH1 centered={true}>Espace rédacteur</AdminH1>
                       <AdminTextInputWrapper>
                            <AdminTextInput type={"text"} placeholder={"Identifiant rédacteur"}/>
                           <AdminInputIcon className="bi bi-person-fill"/>
                       </AdminTextInputWrapper>
                       <AdminTextInputWrapper>
                           <AdminTextInput type={"password"} placeholder={"Mot de passe"}/>
                           <AdminInputIcon className="bi bi-key-fill"/>
                       </AdminTextInputWrapper>
                   </LoginForm>
               </LoginFormWrapper>
            </LoginWrapper>
        );
    }
}

export default Login;
